import React, { Component } from 'react';
import { Table } from 'reactstrap';
import axios from 'axios';

class TableComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: 0,
            date: '',
            name: '',
            driver_id: 0
        };
      }

    componentDidMount() {
        axios.get(`http://localhost:8000/api/deliveries.php`)
            .then(
                res => {
                    this.setState ({
                        id: res.id
                    })
                }
            )
    }

    render () {
        return (
            <div>
                {/* <h1>Deliveries</h1> */}
                <Table class="table">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Driver</th>
                            <th>&nbsp;</th>
                        </tr>
                    </thead>
                    <tbody>
                        <th scope="row">{this.state.id}</th>
                        <td>{this.state.date}</td>
                        <td>{this.state.name}</td>
                        <td>{this.state.driver_id}</td>
                    </tbody>
                </Table>
            </div>
        );
    }
}

export default TableComponent;
